import React from 'react'
import { Table } from 'react-bootstrap';

const MainTable = ({ obj }) => {

console.log(obj);
    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    {obj.thead?.map( (ele, index)=> {
                       return "<th>{ele}</th>"
                    }).join("")}
                </tr>
            </thead>
            <tbody>
                <tr>
                    {obj.tbody ? ( obj.tbody?.map( (row, index)=> {
                        row?.map((val, i) => {
                            return <td>{val}</td>
                        }).join("</tr><tr>")
                    }).join("")) : <td>No Information Available</td> }
                </tr>
            </tbody>
      </Table>
    )
}

export default MainTable
